import React from 'react';
import Encode from './Encode'

class App extends React.Component {
  render() {
    return (
      <div id="App">
        <nav>
          <h1>CryptoImage</h1>
          <p>Fun way to encrypt messages to friends!</p>
        </nav>
        <div id="main">
          <Encode/>
        </div>
        <div id="options">
          <div>Encode</div>
          <div>Decode</div>
        </div>
      </div>
    );
  }
}

export default App;
